import logo, { ReactComponent } from './logo.svg';
import React from 'react';

class FirstComponent extends React.Component {

  render() {

    return ( 
    <div className="App">
        <h1>Just testing out Stuff</h1>
        <div className="New Style">
            <div className="left"> <p>Just some stuff on left</p></div>
            <div className="right"> <p>Just some stuff on Right</p></div>
        </div>
    </div>
  );

}
}

export default FirstComponent;
